LET $current := ARRAY([EFormType], [RecordID]);
LET $descriptionColumns := 
HASH(
	"Contract",  					"Contract Number", 
	"Vendor", 						"Company Name",
	"Procurement", 					"Procurement Number",
	"Project", 						"Project Number",
    "Evaluation", 		    		"Description",
  	"Information Request",  		"File No.", 
	"Subpoena", 					"File No.",
	"Privacy Incident", 			"File No."
); 

LET $altFormName:= HASH(
  	"Insurance",	"Compliance"
  );

LET $getLabelText := $(eFormType, recordID)
(
  	LET $targetColumn := HASH_GET($descriptionColumns, $eFormType);
  	RETURN 
  	IF( $targetColumn = NULL, NULL,
		LET $isthisRecord := ARRAY($eFormType, $recordID) = $current;
		LET $title:= 
		IF( $isthisRecord = TRUE, 
			CURRENT_VALUE($targetColumn),
			ARRAY_FIRST(DB_LOOKUP(
				ARRAY($targetColumn),
				$eFormType, 
				"[RecordID] FAST_EQUAL_TO " & $recordID
			))
		  );
		//shortern the descriptive label/ title
		LET $charCount := LEN($title);
		LET $titleArray := SPLIT($title, " ");
		LET $wordCount := ARRAY_LENGTH($titleArray);

		LET $charLimit := 30; 
		LET $wordLimit := ARRAY_LENGTH( SPLIT( LEFT($title, $charLimit), " ") );

	  RETURN //ARRAY_TAKE($titleArray, $wordLimit)
		IF(
			$wordCount <= $wordLimit, $title,
			ARRAY_JOIN(
				ARRAY_TAKE($titleArray, $wordLimit), " "
			)& " ..."
		)
	  )

); 

LET $getReadAccess := $(eFormType, recordID)
( EBMS_GET_EFORMRECORD_PERMISSION($eFormType, $recordID, "read"));

LET $currentDes := CALL($getLabelText, [EFormType], [RecordID]);
LET $currentAccess := FALSE;

RETURN
IF(
	[Parent Structure] <> NULL, [Parent Structure],
  	(

	  LET $parent := 
	  IF( 
		[RecordID] > 0, 
		(
		  LET $record := EBMS_GET_PARENT_RECORD(ARRAY_FIRST($current), ARRAY_INDEX($current, 2));
		  RETURN 
			  IF(  ARRAY_FIRST($record) == NULL, NULL,
				ARRAY_CONCAT( 
				  $record, 
				  CALL($getLabelText, ARRAY_FIRST($record), ARRAY_INDEX($record, 2)),
				  CALL($getReadAccess, ARRAY_FIRST($record), ARRAY_INDEX($record, 2))
				  )

			  )
	  )); 

	  LET $gParent := 
	  IF( 
		 $parent <> NULL, 
		(
		  LET $record := EBMS_GET_PARENT_RECORD(ARRAY_FIRST($parent), ARRAY_INDEX($parent, 2));
		  RETURN 
			  IF(  ARRAY_FIRST($record) == NULL, NULL,
				ARRAY_CONCAT( 
				  $record, 
				  CALL($getLabelText, ARRAY_FIRST($record), ARRAY_INDEX($record, 2)),
				  CALL($getReadAccess, ARRAY_FIRST($record), ARRAY_INDEX($record, 2))
			  )
		  )
	  )); 

	  LET $hash :=  
	  HASH_MERGE(
		  IF( $parent <> NULL, HASH("parent", 	$parent)),
		  IF( $gParent <> NULL, HASH("gparent", 	$gParent))
	  );

	  LET $parentStructure := 	//2nd instance
	  IF( 
		  ARRAY_LENGTH(HASH_KEYS($hash)) >0, $hash, NULL
	  );

	  LET $parentData:= 
	  ARRAY_WHERE(
		ARRAY(
			$gParent, 
			$parent, 
			ARRAY_CONCAT($current, $currentDes, $currentAccess),
		), $(i,item) $item <> NULL
	   );


	  LET $parentChain:=
		ARRAY_SELECT(
			  $parentData, $(i, item)
			  ARRAY_TAKE($item, 2)
	   );


	  LET $parentLinks :=
	  ARRAY_SELECT(
		  $parentData, $(i, item) 
			  LET $eFormType 		:= ARRAY_FIRST($item);
			  LET $recordID 		:= ARRAY_INDEX($item, 2);
			  LET $descriptiveLabel := ARRAY_INDEX($item, 3);
			  LET $hasReadAccess	:= ARRAY_INDEX($item, 4);
			  LET $URL	:= "records/" & URLENCODE($eFormType) & "/" & $recordID ;
			  LET $showEFormType := $eFormType <> "Vendor";

			  LET $labelColour := 
				  IF(
				   AND($eFormType = [EFormType], $recordID = [RecordID]),
					  "background: #ffffff; color: #5D5D5D;",
					 $hasReadAccess = TRUE,
					  "background: #ffffff; color: #4D87B7;",
					  "background: #ffffff; color: #5D5D5D;"

				  );



			  LET $labeltext:= 
					  IF( $showEFormType == TRUE, " " & COALESCE(HASH_GET($altFormName, $eFormType), $eFormType) ) &
					  IF(NOT(ISBLANK($descriptiveLabel)), " " & $descriptiveLabel);

			  LET $label :=  
				  "<span style=""margin-left: 5px;" & $labelColour & """>" &
				  HTMLENCODE($labeltext) & 
				  "</span>";

			  RETURN 
			  IF( 
				  $hasReadAccess == TRUE, 
				  "<a style=""text-decoration-line: none;"" href=" & HTMLENCODE($URL) & ">" & $label & "</a>",
				  $label 
			  )
	  );

	   LET $separator :=   "<svg style=""vertical-align: bottom; margin-left: 5px; height: 18px;"" xmlns=""http://www.w3.org/2000/svg"" viewBox=""0 0 256 512""><path fill=""#5D5D5D"" d=""M246.6 278.6c12.5-12.5 12.5-32.8 0-45.3l-128-128c-9.2-9.2-22.9-11.9-34.9-6.9s-19.8 16.6-19.8 29.6l0 256c0 12.9 7.8 24.6 19.8 29.6s25.7 2.2 34.9-6.9l128-128z""/></svg>";

	  LET $breadcrumb := "<div style=""height: 23px; padding-left: 5px; font-size: 10pt; color: #5D5D5D; "">You are here:" & ARRAY_JOIN($parentLinks, $separator) & "</div>";

	  RETURN 
	  HASH(
		  "Parent Structure",	$parentStructure,
		  "Parent Data", 		$parentData,
		  "Parent Chain",		$parentChain,
		  "Breadcrumb",		$breadcrumb
		)
	 )
)

Binding.Expression:
 LET $month := [Current Month Year];

 LET $data := DB_REPORT(
    ARRAY(
        "[Type and Method of Alleged Breach]",
        "COUNT([RecordID])"
    ),
    "Privacy Incident",
    "[LineNumber] = 1 AND [Finding] = 'Substantiated' AND [Month Reported] = " & DB_ENCODECONSTANT($month)
);


LET $sorted := ARRAY_SORT($data, $(item) ARRAY_INDEX($item, 1));


LET $row := ARRAY_SELECT(
	$sorted, $(i, item)

LET $url := "TabularReport.aspx?EFormType=Privacy+Incident&profile=Details&where="& URLENCODE("[Month Reported]=")& DB_ENCODECONSTANT($month)&" AND "&URLENCODE("[Finding] = 'Substantiated'" );

//"TabularReport.aspx?EFormType=Freedom+of+Information+Request&profile=Freedom+of+Information+Officer&where="& URLENCODE("[Status]=" )& DB_ENCODECONSTANT(ARRAY_INDEX($item,1));

RETURN 	
	ARRAY(
		HASH("value", 	ARRAY_INDEX($item, 1)), 		
		HASH("value", 	ARRAY_INDEX($item, 2))
	)
);

LET $total := SUM(ARRAY_SELECT($data, $(i, item) ARRAY_INDEX($item, 2)));


LET $headings := ARRAY(
    HASH("heading", "Cause/Type of Substantiated Incidents",    "width", 800),
    HASH("heading", "Number",     								"width", 80)
);    




RETURN HASH(
    "columns", $headings, 
    "rows",    $row,
    "totals", ARRAY(
        ARRAY("Total", $total)
    )
)

LET $user := EBMS_GET_CURRENT_USER();
LET $endDate := [End Date];

 LET $data := DB_REPORT(
    ARRAY(
        "[Category]",
		"[Date Reported]",
        "COUNT([RecordID])"
    ),
    "Privacy Incident",
    "[LineNumber] = 1 AND [Category] IS NOT NULL AND [Finding] = 'Substantiated' AND [Date Reported] > " &DB_ENCODECONSTANT($endDate)
);


LET $hash := ARRAY_TO_HASH_GROUPED($data, $(k, key) ARRAY(ARRAY_INDEX($key, 1), DATEFORMAT(ARRAY_INDEX($key, 2), "yyyy-MM")), $(v, value) ARRAY_INDEX($value, 3));

LET $months := ARRAY_SELECT(RANGE(1, 12), $(i, item) DATEFORMAT(DATEADD("month", $item, [End Date]), "yyyy-MM"));


LET $companies := ARRAY_DISTINCT(ARRAY_SELECT($data, $(i, item) ARRAY_INDEX($item, 1)));

LET $rowsWithTotals := ARRAY_SELECT($companies, $(c, company)
	LET $cells := ARRAY_SELECT($months, $(m, month)
		LET $url := "TabularReport.aspx?EFormType=Privacy+Incident&profile=Details&where="&URLENCODE("[Category]=" )& DB_ENCODECONSTANT($company) & " AND "&URLENCODE("[Date Reported]=" ) & DB_ENCODECONSTANT($month);
		RETURN HASH("value", SUM(HASH_GET($hash, ARRAY($company, $month))))
	);
	LET $monthlyTotals := ARRAY_SELECT($cells, $(c, cell) HASH_GET($cell, "value"));
	RETURN ARRAY(ARRAY_CONCAT(ARRAY($company), $cells), $monthlyTotals)
);

LET $rows := ARRAY_SELECT($rowsWithTotals, $(i, item) ARRAY_INDEX($item, 1));

LET $rowsTotal := ARRAY_SELECT($rows, $(i, item) SUM($item));

LET $rowsWithTotal := ARRAY_SELECT($rows,$(i,row)ARRAY_CONCAT($row,ARRAY(ARRAY_INDEX($rowsTotal,$i))));


LET $monthlyTotals := ARRAY_SELECT($rowsWithTotals, $(i, item) ARRAY_INDEX($item, 2));

LET $transposeMonthlyTotals := ARRAY_SELECT(ARRAY_TRANSPOSE($monthlyTotals), $(i, item) SUM($item));

LET $grandTotal := SUM($rowsTotal);  

LET $totalsRow := ARRAY_CONCAT(ARRAY("Total"), $transposeMonthlyTotals, $grandTotal);


LET $headings := ARRAY_SELECT(ARRAY_CONCAT(ARRAY("Notifier"), $months, "Total"), $(h, heading)
	HASH("heading", $heading, "width",65)
);


RETURN  HASH(
    "columns", $headings, 
    "rows",    $rowsWithTotal,
	"totals", $totalsRow
    )

